As a huge 
@thekillers
 fan I have to say, #ImplodingTheMirage is the weakest album from the band to date, I guess I've just been spoiled by them. Like I said I'm a huge fan so I'll give them a mulligan on this one.

I picked up my copy this morning at 
@rlnstonesmusic
! If anyone in Chicago or the suburbs are looking for a copy hit them up! The album is solid front to back, current favorites are “blowback”, “my god”, & “my own soul’s warning”
